import React from "react";
import { Col, Row, Container } from 'react-bootstrap';

function Main() {
    return (
        <Container>
            <Row>
                <Col lg={6} md={12}>
                    <p style={'font-size:'}>Выберите товары<br/></p>
                      <h1>  <strong>для вашего питомца</strong></h1>
                    
                </Col>
            </Row>
        </Container>
    )
}

export default Main;
